import React from "react";
import Card from "./Card";
import { robots } from "./robots";

const Cardlist = (props) => {
  const allCards = (val, ind, arr) => {
    <Card id={robots[0].id} title={robots[0].name} email={robots[0].email} />;
  };
  return <div></div>;
};

export default Cardlist;
